description:
                                    Описание от продавца                            
Продаю 2 и 3-комнатные квартиры в ЖК "Мурас" от надежного застройщика Роял Констракшн. Дом кирпичный, коммуникации центральные, сдан ПСО (можете начать ремонт).
Список актуальных квартир:
2-комнатная, 72,72 кв.м., на 10-этаже;
2-комнатная, 88,04 кв.м., на 7-этаже;
3-комнатная, 121,33 кв.м., на 8-этаже;
3-комнатная, 87,71 кв.м, на 10-этаже;
Расположение дома хорошее: школы, детские сады, различные магазины, аптеки и.т.п... в шаговой доступности.
Обмен на авто и варианты рассрочки рассмотрим при оплате 50% и более от общей стоимости.
Price: 620$ за квадратный метр (торг есть)
Звоните: 0509 201809; 0559 201809 W/А Батыйхан

